🔹 Welcome to KutuBimba YBA HUB!

Main Features:
• AutoFarm — the most customizable autofarm ever exist!
• AutoSell — dont work (for now)
• AutoSkill — auto-use skills by keybinds
• Player — Fly (Velocity/Legacy methods), NoClip, Infinite Yield commands
• Visual — shaders, china hat, mega trails, snow, fullbright, custom FOV
• Duper — basic item dupe from backpack (HIGH BAN RISK! And its a PREMIUM function!)
• Discord — community link + support

Tips & Safety:
• Recommended to use "Velocity" fly method — it's more stable and safer than Legacy.
• For maximum safety in AutoFarm, always use "Stud" travel method (no kicks detected).
• You can try "Extreme" speed — many users (including me) haven't been banned yet, but it's risky on public servers. Stick to Stud + Extreme if you're careful.
• If you want Duper functions, you need the Premium script version — join Discord for details!

• Infinite Yield tips: Type commands in chat with ";" prefix (e.g. ;fly, ;speed 200, ;god, ;noclip) DONT USE FLY BY Infinity Yelds!!! 

Always use alts for risky features like Duper or extreme speeds. Don't abuse on main account!

If something doesn't work — rejoin the game or ask in Discord.

